  constructor(props) {
    super(props);
  }

  isExpandableRow() {
    return true;
  }

  expandComponent(row) {
    return (
      <BSTable data={ row.expand } />
    );
  }

  render() {
    const options = {
      expandRowBgColor: 'rgb(242, 255, 163)'
    };
    const { datas } = this.state;
    return (
      <BootstrapTable data={ datas.rows }
        options={ options }
        search
        pagination
        expandableRow={ this.isExpandableRow }
        expandComponent={ this.expandComponent } columnFilter >
        <TableHeaderColumn dataField='name' isKey={ true } width="150">Callers</TableHeaderColumn>
        <TableHeaderColumn dataField='position' width="270">Call Status</TableHeaderColumn>
        <TableHeaderColumn dataField='date' width="150">Time & Date</TableHeaderColumn>
        <TableHeaderColumn dataField='age' width="100">Duration</TableHeaderColumn>
        <TableHeaderColumn dataField='office' width="200">Bill Status</TableHeaderColumn>
        <TableHeaderColumn dataField='salary' width="100">Fee</TableHeaderColumn>
        <TableHeaderColumn dataField='salary' width="100">Rate</TableHeaderColumn>
      </BootstrapTable>
      
    );
  }
